import axios from 'axios';

export const UserRegistration = (d) => {

    const password = d.password;
    d['password']=d.password;
    const email = d.email;
    d['email']=d.email;
    const username = d.username;
    d['username']=d.username;

    return axios.post('http://localhost:4000/users/register',d)
        .then(res => res.status);
};
